import React, { useEffect, useState } from 'react'

const Userlist = ({ data }) => {
    let renderedusers = data.map((item) => {
        return (
            <div key={item.id}>
                <p>
                    <strong>{item.name}</strong>
                </p>
            </div>
        )
    })

    return (

        <div>

            {renderedusers}
        </div>
    )
}
const searchuser = HOC(Userlist, "users");
export default searchuser
